import React, { useState, useEffect } from 'react';

import Link from 'next/link';

import PropTypes from 'prop-types';

import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Box from '@material-ui/core/Box';

import Query from './query';
import SECTIONS_QUERY from '../apollo/queries/sections/sections';


const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        backgroundColor: theme.palette.background.paper
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
}));

function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
        <Typography
            component="div"
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && <Box p={3}>{children}</Box>}
        </Typography>
    );
}

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

export default props => {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Query query={SECTIONS_QUERY}>
                        {({ data: { sections } }) => {
                            return <TabSection data={sections} />
                        }}
                    </Query>
                    <Button edge="end" color="inherit">Login</Button>
                </Toolbar>
            </AppBar>
        </div>
    );
}

const TabSection = props => {
    const [value, setValue] = useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    
    return (
        <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
            {props.data.map((section, index) =>
                <Link href={"/" + section.title.toLowerCase()} key={section.title + "NextLink"}>
                    <a key={section.title + "Link"}>
                        <Tab label={section.title} {...a11yProps(index)} />
                    </a>
                </Link>
            )}
        </Tabs>
    );
}
